window.bookSummaryJSON = "<p><b>Rogue and Ara have fought tooth and nail for each other and their people, defying even death in their pursuit of peace and love.</b></p> <p>But when their bond was finally solidified, another chain was broken, and Rogue's hidden magic was released—a shock that no one, not even Rogue himself, saw coming.</p> <p>Now, with broken curses, a powerful mate bond, and two lines of ancient magic, Rogue and Ara must tread carefully through uncharted territory to find the one thing that could turn the tides in their favor: an impossibly lost object, one that's been forgotten to time, but needed now more than ever—and they must do so before Adonis' armies rise again, the ever-present threat on the horizon.</p>"; 
